export const ClientsSection = () => {
  return (
    <div className="w-full">
      <h2 className="text-4xl sm:text-5xl lg:text-6xl font-extrabold font-fustat text-black text-left mb-8">
        Our Clients
      </h2>

      <div className="w-full h-1 bg-gray-800 mb-8" />

      <p className="text-lg sm:text-xl lg:text-2xl text-gray-700 leading-relaxed text-center max-w-2xl mx-auto">
        We are proud to partner with leading organizations across the power, oil
        & gas, and process industries. Our clients trust us for reliable
        auxiliary systems, engineering precision, and long-term operational
        performance. With thousands of installations in service, our solutions
        continue to support critical operations in India and across global
        markets.
      </p>
    </div>
  );
};
